import React, { Component } from 'react';
import css from '../../pictures/css.png';
import less from '../../pictures/less.png';
import sass from '../../pictures/sass.png';
import react from '../../pictures/react.png';
import html from '../../pictures/html.png';
import adobeXd from '../../pictures/adobeXd.png';
import responsive from '../../pictures/responsive.png';
import linux from '../../pictures/linux.png';
import github from '../../pictures/github.png';
import trello from '../../pictures/trello.png';
import vscode from '../../pictures/vscode.png';
import { Grid, Icon } from 'semantic-ui-react'
import './Skills.sass';

/* import from '../../pictures/.png';
import from '../../pictures/.png'; */

class Skills extends Component {
  render() {
    return (
      <div id="skills" style={{ background: 'red' }}>
            <Grid columns='three'>
          <Grid.Row>
            <Grid.Column textAlign='center'>front-end & wireframe</Grid.Column>
            <Grid.Column textAlign='center'>environnement de travail</Grid.Column>
            <Grid.Column textAlign='center'>back-end</Grid.Column>
          </Grid.Row>
        </Grid>

        <Grid columns='three'>
          <Grid.Row>

            <Grid.Column textAlign='center' style={{ display: 'flex'}}>

              <div className="icon-skills"><Icon className="phone-icon" name='css3 large' /><img src={css} alt="logo" style={{ width: '50px' }} /><p className="">css3</p></div>
              <div className="icon-skills"><Icon className="phone-icon" name='less large' /><img src={less} alt="logo" style={{ width: '50px' }} /><p className="">less</p></div>
              <div className="icon-skills"><Icon className="phone-icon" name='sass large' /><img src={sass} alt="logo" style={{ width: '50px' }} /><p className="">sass</p></div>
              <div className="icon-skills"><Icon className="phone-icon" name='react large' /><img src={react} alt="logo" style={{ width: '50px' }} /><p className="">react.js</p></div>
              <div className="icon-skills"><Icon className="phone-icon" name='html5 large' /><img src={html} alt="logo" style={{ width: '50px' }} /><p className="">html5</p></div>
              <div className="icon-skills"><Icon className="phone-icon" name=' large' /><img src={adobeXd} alt="logo" style={{ width: '50px' }} /><p className="">adobe XD</p></div>
              <div className="icon-skills"><Icon className="phone-icon" name=' large' /><img src={responsive} alt="logo" style={{ width: '50px' }} /><p className="">responsive design</p></div>
            </Grid.Column>
            <Grid.Column textAlign='center' style={{ display: 'flex'}}>

              <div className="icon-skills"><Icon className="phone-icon" name='linux large' /><img src={linux} alt="logo" style={{ width: '50px' }} /><p className="">ubuntu</p></div>
              <div className="icon-skills"><Icon className="phone-icon" name='github large' /><img src={github} alt="logo" style={{ width: '50px' }} /><p className="">github</p></div>
              <div className="icon-skills"><Icon className="phone-icon" name='trello large' /><img src={trello} alt="logo" style={{ width: '50px' }} /><p className="">trello</p></div>
              <div className="icon-skills"><Icon className="phone-icon" name=' large' /><img src={vscode} alt="logo" style={{ width: '50px' }} /><p className="">vscode</p></div>
            </Grid.Column>
            <Grid.Column textAlign='center'>
              <p>Back-end</p>
              {/*    <img src={} alt="logo" />
        <img src={} alt="logo" /> */}
            </Grid.Column>
          </Grid.Row>
        </Grid>
      </div>
    );
  }
}

export default Skills;
